onBeforeUnmount(() => {
    bounce.pause();

    // for some reason, if I don't reset everything, the thing will 'stick' on new instances
    bpHeadHit.style.display = 'none';
    bpHead.style.display = 'inline';

    anime({
        targets: image.value!.querySelectorAll('.rightHand, .leftHand, .rightFoot, .leftFoot, .torso, .head, .headHit, .leftArm, .leftLeg, .rightArm, .rightLeg'),
        translateY: 0,
        translateX: 0,
        rotate: 0,
        easing: 'linear',
        duration: 0,
    });

    anime({... restore(bpLeftArm), duration: 0 });
    anime({... restore(bpRightArm), duration: 0 });
    anime({... restore(bpLeftLeg), duration: 0 });
    anime({... restore(bpRightLeg), duration: 0 });
})

