            bpHeadHit.style.display = 'none';
            bpHead.style.display = 'inline';
        }
    }, 200);

    hitTl.add({ ...restore(bpLeftArm), duration: 200 }, 200)
    hitTl.add({ ...restore(bpRightArm), duration: 200 }, 200)
    hitTl.add({ ...restore(bpLeftLeg), duration: 200 }, 200)
    hitTl.add({ ...restore(bpRightLeg), duration: 200 }, 200)

    hitTl.finished.then(() => bounce.play());
    trackAnimation(hitTl);
}

